    @Test
    void toPrevTest() throws Exception {
        var rfn = newRfn();
        try (MockedStatic<NasaReaderBase> theMock = Mockito.mockStatic(NasaReaderBase.class)) {
            theMock.when(() -> NasaReaderBase.readUrl(any(URL.class))).thenReturn(jsonReply5images889, jsonReply13images888);
            //
            rfn.loadBySol(889);//_loadInitial("https://mars.nasa.gov/mars2020-raw-images/pub/ods/surface/sol/00889/ids/edr/browse/ncam/NLF_0889_0745848543_413ECM_N0440000NCAM00501_01_295J01.png");

            theMock.verify(
                    () -> NasaReaderBase.readUrl(any(URL.class)),
                    times(1)
            );
            assertEquals(
                    listOfKeys889,
                    new ArrayList<>(rfn.nmap.keySet())
            );
            assertEquals(
                    null,
                    rfn.getCurrentKey()
            );

            for (int i = listOfKeys889.size() - 1; 0 <= i; i--) {
                rfn.toPrev();
                assertEquals(
                        listOfKeys889.get(i),
                        rfn.getCurrentKey()
                );
                theMock.verify(
                        () -> NasaReaderBase.readUrl(any(URL.class)),
                        times(1)
                );
            }

            for (int i = listOfKeys888.size() - 1; 0 <= i; i--) {
                rfn.toPrev();
                assertEquals(
                        listOfKeys888.get(i),
                        rfn.getCurrentKey(),
                        "mismatch at index i="+i
                );
                theMock.verify(
                        () -> NasaReaderBase.readUrl(any(URL.class)),
                        times(2)
                );
            }
        }
    }

